import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {

    const items = ['Lern React', 'Build Awesome App'];
    return(
        <ul>
            <li>{items[0]}</li>
            <li>{items[1]}</li>
        </ul>
    );
};

const AppHeader = () => {
    return(
        <h1>My Todo List</h1>
    );
}

const SearchPanel = () => {
    return (
        <input type="text" placeholder="search"/>
    );
};

const App = () => {
    return(
        <div>
            <AppHeader />
            <SearchPanel />
            <TodoList />
        </div>
    );
};

ReactDOM.render(<App />, document.querySelector('#root'));
